import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const CreateClassroom = () => {
    const [students, setStudents] = useState([]);
    const [className, setClassName] = useState('');
    const [selectedStudents, setSelectedStudents] = useState([]);
    const [schedule, setSchedule] = useState({
        Monday: { startTime: '', endTime: '' },
        Saturday: { startTime: '', endTime: '' },
    });
    const route = "http://localhost:5000";
    const navigate = useNavigate();

    useEffect(() => {
        // Fetch students
        axios.get(`${route}/api/getstudents`)
            .then(response => {
                setStudents(response.data);
            })
            .catch(error => {
                console.error('Error fetching students:', error);
            });
    }, []);

    const handleStudentSelection = (studentId) => {
        setSelectedStudents(prev => 
            prev.includes(studentId) 
                ? prev.filter(id => id !== studentId) 
                : [...prev, studentId]
        );
    };

    const handleScheduleChange = (day, timeType, value) => {
        setSchedule(prev => ({
            ...prev,
            [day]: { ...prev[day], [timeType]: value }
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        const classroomData = {
            name: className,
            students: selectedStudents,
            schedule,
        };

        axios.post(`${route}/api/createclassroom`, classroomData)
            .then(response => {
                console.log('Classroom created successfully:', response.data);
                navigate('/dashboard');
            })
            .catch(error => {
                console.error('Error creating classroom:', error);
            });
    };

    return (
        <div className="container">
            <h2>Create Classroom</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>Classroom Name</label>
                    <input
                        type="text"
                        className="form-control"
                        value={className}
                        onChange={(e) => setClassName(e.target.value)}
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Schedule for Monday</label>
                    <input
                        type="time"
                        className="form-control"
                        value={schedule.Monday.startTime}
                        onChange={(e) => handleScheduleChange('Monday', 'startTime', e.target.value)}
                        required
                    />
                    <input
                        type="time"
                        className="form-control"
                        value={schedule.Monday.endTime}
                        onChange={(e) => handleScheduleChange('Monday', 'endTime', e.target.value)}
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Schedule for Saturday</label>
                    <input
                        type="time"
                        className="form-control"
                        value={schedule.Saturday.startTime}
                        onChange={(e) => handleScheduleChange('Saturday', 'startTime', e.target.value)}
                        required
                    />
                    <input
                        type="time"
                        className="form-control"
                        value={schedule.Saturday.endTime}
                        onChange={(e) => handleScheduleChange('Saturday', 'endTime', e.target.value)}
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Select Students</label>
                    <div className="row">
                        {students.map(student => (
                            <div key={student._id} className="col-md-4">
                                <div className="btn-group" role="group" aria-label="Student selection">
                                    <input
                                        type="checkbox"
                                        className="btn-check"
                                        id={`student-${student._id}`}
                                        checked={selectedStudents.includes(student._id)}
                                        onChange={() => handleStudentSelection(student._id)}
                                    />
                                    <label
                                        className="btn btn-outline-primary"
                                        htmlFor={`student-${student._id}`}
                                    >
                                        {student.name}
                                    </label>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>

                <button type="submit" className="btn btn-primary">Create Classroom</button>
            </form>
        </div>
    );
};

export default CreateClassroom;
